DROP TABLE IF EXISTS cishfid.identification_type;

DROP SEQUENCE IF EXISTS cishfid.identification_type_id_seq;

CREATE SEQUENCE IF NOT EXISTS cishfid.identification_type_id_seq
    INCREMENT 1
    START 1
    MINVALUE 1
    MAXVALUE 9223372036854775807
    CACHE 250;

create table cishfid.identification_type
(
    id bigint NOT NULL,
    stm_tp_cd text,
    cmpny_tp_cd integer,
    src_tbl_no integer,
    src_tbl_nme text,
    src_cat text,
    idfctn_src_tp_cd text,
    idfctn_src_tp_desc text,
    idfctn_issur_cntry_cd text,
    tbl_nme text,
    idfctn_entps_tp_cd integer,
    idfctn_parent_tp_cd  text,
    id_tp_desc text,
    eff_dte text,
    exp_dte text,
    CONSTRAINT identification_type_pkey PRIMARY KEY (id)
);



